import React from "react";
import { Button } from "@material-ui/core";

class LoginPage extends React.Component {
    render() {
        return (
            <div>
                <Button
                    variant = "contained" 
                    color = "secondary" >
                    Sign In with Google
                </Button>
            </div>
        )
    }
}

export default LoginPage;
